import {useLocation} from 'react-router-dom'

import Message from "../layout/Message"


function Projects() {

    const location = useLocation()

    return (
        <div>
            <h1>Meus Projetos</h1>
            <Message msg="Alguma mensagem." />
        </div>
    )
}

export default Projects
